import React from 'react';

function Pagination({ currentPage, totalPages, onPageChange }) {
  let prevPage = null;
  let nextPage = null;

  const renderPageNumbers = () => {
    const pageNumbers = [];

    // Calculate the previous and next page numbers
    prevPage = currentPage > 1 ? currentPage - 1 : null;
    nextPage = currentPage < totalPages ? currentPage + 1 : null;

    // Render the previous page number if available
    if (prevPage !== null || prevPage !==0) {
      pageNumbers.push(
        <li key={prevPage}>
          <a href="#" onClick={() => onPageChange(prevPage)}>{prevPage}</a>
        </li>
      );
    }

    // Render the current page number
    pageNumbers.push(
      <li key={currentPage} className="active">
        <a href="#">{currentPage}</a>
      </li>
    );

    // Render the next page number if available
    if (nextPage !== null) {
      pageNumbers.push(
        <li key={nextPage}>
          <a href="#" onClick={() => onPageChange(nextPage)}>{nextPage}</a>
        </li>
      );
    }

    return pageNumbers;
  };

  return (
    <ul className="pagination">
      {prevPage !== null && (
        <li>
          <a href="#" onClick={() => onPageChange(prevPage)}>
            Previous
          </a>
        </li>
      )}
      {renderPageNumbers()}
      {nextPage !== null && (
        <li>
          <a href="#" onClick={() => onPageChange(nextPage)}>
            Next
          </a>
        </li>
      )}
    </ul>
  );
}

export default Pagination;
